@JacobAndCo Astronomia Art Dragon Rose Gold Baguette 🐲 The mythical dragon is a magnificent creature, representing strength and power, glory and good fortune. The Jacob & Co. artisan who crafts the dragon first does research to find the perfect dragon as source material, then works on the computer to create a detailed 3-D plan. From this, the 18K gold cast is made. Finally, after two or more months, the detail work begins as every part of the dragon is gone over with a fine-toothed comb, every surface finished and engraved, then polished.

The Astronomia Tourbillon Baguette's case measures 50 millimeters in diameter and 25 millimeters thick between the highest point of its specially curved front sapphire crystal and the lowest point of its case. Crafted from 18K rose gold, the case features four sapphire crystal windows installed throughout the periphery, allowing for unhindered viewing of the spectacular caliber and the artwork inside. The lugs are invisibly set with baguette-cut white diamonds.

